Individuals from all walks of life coming together for a weekend of mutual learning, testing, and training? That's what airsoft means to us - an everyman's training tool. It was a pleasure for our team of shooters and a few of our CS guys and friends to share the field with those in the airsoft community and continue to bridge the gap alongside others within our own industry. If you're sleeping on airsoft as a legitimate training tool, waste no more time in getting a crew together and hitting up one of these events. While not everything translates directly to "real world", it will absolutely help you identify weaknesses in yourself as an individual and your team as a whole.⁠
-⁠
@americanmilsim Copperhead 2021. Playas Training Center, New Mexico.
